                ]});
            }*/
        })
        
    }

    render()
    {
        console.log('mashallah', this.state.listings);
        return (

            <ul>
                {
                    this.state.listings
                        .map((listing, index) =>
                            <li key={index}>
                                { listing }
                            </li>
                        )
                }
            </ul>
        );
    }


}
